import React from 'react';
import { useHistory } from 'react-router-dom';
import '../styles/homepageStyle.css';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
// import * as mdb from 'mdb-ui-kit'; // lib


const Homepage = () => {

  let history = useHistory()

  const loginBtn = () => {
    history.push('/login')
  }
  const signUpBtn = () => {
    history.push('/signUp')
  }

  return (

    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          mt: 10,
          ml: 53,
          width: 428,
          height: 428,
          // backgroundColor: "#68a3d6"
        },
      }}
    >
      <Paper elevation={24} className="button-background">

        {/* className="button-background" */}

        <div >

          <Button variant="outlined" type="button" className="btn1"  onClick={loginBtn}>Login</Button>

          <br />

          <Button variant="outlined"  type="button"  onClick={signUpBtn}>Sign In</Button>

        </div>

      </Paper>
    </Box>
  );
  // <div className="hp-buttons">

  //     {/* <img src="../styles/images/bg-photo2.jpg"/> */}

  //     <div className="button-background">

  //         <button type="button" id="btn1-Hp" class="btn btn-primary" onClick={loginBtn}>Login</button>

  //         <button type="button" id="btn2-Hp" class="btn btn-success" onClick={signUpBtn}>Sign In</button>
  //     </div>


  // </div>
  // );
}

export default Homepage;
